script: |
  super -f text -I q6341.spq | sort > q6341.out

inputs:
  - name: q6341.spq
    data: |
      SELECT * FROM tab2 (FORMAT parquet) AS cor0 WHERE NOT + col2 * + - 81 * + - ( + col2 ) / 36 + - 88 IS NULL AND NOT ( 47 ) NOT BETWEEN - col0 AND + col0;
  - name: tab2

outputs:
  - name: q6341.out
    data: |
      64	77	40
      75	67	58
